/* eslint-disable react/prop-types */
/* eslint-disable no-console */
import React, { useState } from 'react';
import { withRouter } from 'react-router';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Login from './Pages/Login';
import ContactList from './Pages/ContactList';
import ShowContacts from './Pages/ShowContacts';

const App = ({ history, location }) => {
  const [searchValue, setSearchValue] = useState(null);
  const handleSearch = (e) => {
    setSearchValue(e.target.value);
  };
  return (
    <div>
      <Router>
        <div>
          <Navbar handleSearch={handleSearch} />
          <Switch>
            <Route exact path="/login" component={Login} />
            <Route exact path="/contact-list" component={() => <ContactList search={searchValue} />} />
            <Route exact path="/show-list/permission" component={ShowContacts} />
            <Route exact path="/show-list/list/success" render={() => (window.location.replace('https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?access_type=offline&scope=https%3A%2F%2Fwww.googleapis.com%2Fauth%2Fcontacts.readonly&response_type=code&client_id=6808591183-4msj8nlg44stk09uqr8hjrt5itcmks9n.apps.googleusercontent.com&redirect_uri=http%3A%2F%2Flocalhost%3A4000&flowName=GeneralOAuthFlow'))} />
          </Switch>
        </div>
      </Router>
    </div>
  );
};
export default withRouter(App);
